pragma solidity ^0.8.4;

import "../ERC20StakingRewardsDistribution.sol";
import "../interfaces/IERC20StakingRewardsDistribution.sol";
import "../ERC20StakingRewardsDistributionFactory.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract MockUser {
    IERC20StakingRewardsDistribution internal distribution;
    address internal stakingToken;

    constructor(address _distribution, address _stakingToken) {
        distribution = IERC20StakingRewardsDistribution(_distribution);
        stakingToken = _stakingToken;
        // Approve staking tokens to distribution
        IERC20(_stakingToken).approve(_distribution, type(uint256).max);
    }

    function stake(uint256 _amount) public {
        distribution.stake(_amount);
    }

    function withdraw(uint256 _amount) public {
        distribution.withdraw(_amount);
    }

    function claim(uint256[] memory _amounts) public {
        distribution.claim(_amounts, address(this));
    }

    function claimAll() public {
        distribution.claimAll(address(this));
    }

    function cancel() public {
        distribution.cancel();
    }

    function recoverUnassignedRewards() public {
        distribution.recoverUnassignedRewards();
    }
}

